import { useState, useRef } from 'react';
import { DataTable, Table } from '@primer/react/experimental';
import {
  Box,
  Dialog,
  Link,
  Pagination,
  Heading,
  Text,
  TextInput,
  Button,
} from '@primer/react';
import { requestLog } from '../../../data/Data';
import { FilterIcon, XCircleFillIcon } from '@primer/octicons-react';

export function RequestLog() {
  const title = 'Request log';
  const description = 'View usage by individual request';

  const [isOpen, setIsOpen] = useState(false);
  const returnFocusRef = useRef(null);

  return (
    <Box sx={{ width: '100%', mt: 5 }}>
      <Box
        sx={{
          pb: 2,
          mb: 3,
          borderBottom: '1px solid',
          borderColor: 'border.default',
          width: '100%',
        }}
      >
        <Heading
          sx={{
            fontSize: 3,
          }}
        >
          {title}
        </Heading>
        <Text
          sx={{
            color: 'fg.muted',
            fontSize: 1,
          }}
        >
          {description}
        </Text>
      </Box>
      <Box
        sx={{
          display: 'flex',
          width: '100%',
        }}
      >
        <Button
          sx={{
            borderTopRightRadius: 0,
            borderBottomRightRadius: 0,
            borderRight: 0,
          }}
          leadingVisual={FilterIcon}
        >
          Filter
        </Button>
        <Box
          sx={{
            position: 'relative',
            mb: 3,
            width: '100%',
          }}
        >
          <TextInput
            sx={{
              width: '100%',
              borderTopLeftRadius: 0,
              borderBottomLeftRadius: 0,
              pl: 11,
            }}
            trailingAction={
              <TextInput.Action
                icon={XCircleFillIcon}
                aria-label='Clear input'
                sx={{ color: 'fg.subtle' }}
              />
            }
          />
          <Box
            sx={{
              position: 'absolute',
              left: 2,
              top: '50%',
              transform: 'translateY(-50%)',
              fontSize: 1,
              gap: 1,
              display: 'flex',
            }}
          >
            <Text>rate limited:</Text>
            <Text
              sx={{
                bg: 'accent.subtle',
                borderRadius: 1,
                px: 1,
                color: 'accent.emphasis',
              }}
            >
              true
            </Text>
          </Box>
        </Box>
      </Box>
      <Table.Container
        sx={{
          width: '100%',
        }}
      >
        <DataTable
          data={requestLog}
          columns={[
            {
              header: 'Request',
              field: 'name',
              rowHeader: true,
              renderCell: (row) => (
                <Box
                  sx={{
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <Link
                    data-testid='trigger-button'
                    ref={returnFocusRef}
                    onClick={() => setIsOpen(true)}
                    sx={{
                      color: 'fg.default',
                      fontSize: 1,
                      cursor: 'pointer',
                    }}
                  >
                    <Text mr='2'>{row.type}</Text>
                    <Text fontWeight='normal'>{row.path}</Text>
                  </Link>
                  <Text
                    sx={{
                      color: 'fg.muted',
                      fontWeight: 400,
                    }}
                  >
                    {row.ip}
                  </Text>
                  <Dialog
                    returnFocusRef={returnFocusRef}
                    isOpen={isOpen}
                    onDismiss={() => setIsOpen(false)}
                    aria-labelledby='header'
                    footerButtons={[
                      {
                        buttonType: 'default',
                        content: 'Close',
                        onClick: setIsOpen(false),
                      },
                    ]}
                    sx={{
                      borderRadius: '12px',
                      overflow: 'hidden',
                    }}
                  >
                    <div data-testid='inner'>
                      <Dialog.Header
                        id='header'
                        sx={{
                          bg: 'canvas.default',
                        }}
                      >
                        Request summary
                      </Dialog.Header>
                      <Box
                        fontSize='1'
                        p={3}
                        sx={{
                          display: 'flex',
                          flexDirection: 'column',
                          gap: 2,
                        }}
                      >
                        <Box sx={{ display: 'flex' }}>
                          <Text sx={{ width: '100px' }}>Path</Text>
                          <Text sx={{ fontWeight: 'normal' }}>{row.path}</Text>
                        </Box>
                        <Box sx={{ display: 'flex' }}>
                          <Text sx={{ width: '100px' }}>Status</Text>
                          <Text
                            sx={{
                              fontWeight: 'normal',
                              display: 'flex',
                              alignItems: 'center',
                              gap: 1,
                            }}
                          >
                            <Box
                              sx={{
                                display: 'inline-block',
                                bg: 'red',
                                width: '8px',
                                height: '8px',
                                borderRadius: '100px',
                              }}
                            />
                            {row.status}
                          </Text>
                        </Box>
                        <Box sx={{ display: 'flex' }}>
                          <Text sx={{ width: '100px' }}>Request</Text>
                          <Text sx={{ fontWeight: 'normal' }}>
                            {row.request} / 15,000 per hour
                          </Text>
                        </Box>
                        <Box sx={{ display: 'flex' }}>
                          <Text sx={{ width: '100px' }}>Time</Text>
                          <Text sx={{ fontWeight: 'normal' }}>{row.time}</Text>
                        </Box>
                      </Box>
                    </div>
                  </Dialog>
                </Box>
              ),
            },
            {
              header: 'Status',
              field: 'type',
              renderCell: (row) => (
                <Text
                  sx={{
                    fontSize: 1,
                  }}
                >
                  {row.status}
                </Text>
              ),
            },
            {
              header: 'Date',
              field: 'updatedAt',
              renderCell: (row) => (
                <Text
                  sx={{
                    fontSize: 1,
                  }}
                >
                  {row.lastUsed}
                </Text>
              ),
            },
          ]}
        />
      </Table.Container>
      <Box>
        <Pagination
          pageCount={4}
          currentPage={1}
          onPageChange={(e) => e.preventDefault()}
          showPages={{
            narrow: false,
          }}
        />
      </Box>
    </Box>
  );
}
